import React from 'react';
import { Link } from 'react-router-dom';

import './style.css';

export default function SectionAbout() {
    return (
        <div className="container-about">
            <div className="about">
                <div className="banner-about">
                    <h1>Banner</h1>
                </div>

                <div className="text-about">
                    <h1>Vivemos Tecnologia!</h1>
                </div>
            </div>
        </div>       
    )
}
